import CustomButton from '../../Button/CustomButton';
import { useAuth } from '../../../context/useAuthContext';

const Logout = () => {
    const { logout } = useAuth();

    const handleLogout = () => {
        logout();
    };

    return (
        <CustomButton style='logout' btnText='logout' onClick={handleLogout}/>
    );
};

export default Logout;
